import axios from "axios";
import React from "react";
// import Modal from "react-awesome-modal";
import Modal from '@material-ui/core/Modal'
import Select from "react-select";
import { toast } from "react-toastify";
import ReactTooltip from "react-tooltip";
import {
    addFilterPricing,
    addKantoBizSearchResults,
    addSearchLoading,
    changeEventsToSearch,
    // changeInitialized
} from "../functionTools/functionProps";
import { generatePagination, onChangeListWithValueLabel, shuffleArray } from "../functionTools/tools";
import Results from "./prestations/results/results";
import KantoTabs from './tabs';
import { InputLabel, FormControl, NativeSelect } from '@material-ui/core'
import red from "@material-ui/core/colors/red";
import { createMuiTheme, ThemeProvider } from "@material-ui/core/styles";

const defaultMaterialTheme = createMuiTheme({
    overrides: {
        MuiNativeSelect: {
            select: {
                color: 'white',
                textDecoration: 'black',
            },
            root: {
                borderBottom: '2px solid red',
                '&.focus': {
                    borderButtom: '2px solid white'
                },
                textDecoration:'white'
            },
            input: {
                color: 'white',
                

            },
            icon: {
                color: 'white',
            }
        },
        MuiInputLabel:{
            root:{
                color:"white"
            }
        }
    },
    palette:{
        primary:red
    }

});



export const EventAndThematics = (
    headers,
    dispatch,
    setStateResult,
    displayOne,
    setShow,
    show,
    listOfEvents,
    setEvents,
    events,
    thematics,
    setThematics,
    lightModeOn
) => {

    const searchService = async (key, value) => {
        await dispatch(addSearchLoading(true));
        if (key === "events")
            dispatch(changeEventsToSearch(value));
        axios.get("api/service_search/moment/" + key + "/" + value, { headers: headers }).then(
            async (resp) => {
                let data = resp.data;
                if (data.length >= 2) {
                    await dispatch(addFilterPricing({
                        "min": resp.data[0]["price"],
                        "max": resp.data[resp.data.length - 1]["price"]
                    }));
                    data = shuffleArray(data);
                }
                // await dispatch(changeInitialized(false));
                await setStateResult(generatePagination(data, displayOne));
                await dispatch(addKantoBizSearchResults(data));
                await dispatch(addSearchLoading(false));
                if (data.length === 0) toast.warn("Pas de prestations trouvées");
                else await Results.onScrollViewSearch();
            })
    };

    const generatorEventCard = (position_name, key, title, desc, image) => {
        return (
            <div className={lightModeOn ? (position_name + " theme-light") : (position_name + " theme-dark")} style={{ margin: "20px" }}>
                <div className="card-image">
                    <img alt={title} src={image} />
                </div>
                <div className="card-text text-center">
                    <h4 className="text-red">{title}</h4>
                    <small className={lightModeOn ? "text-black" : "text-white"}>{desc}</small>
                    <button className="btn btn-outline-info mt-1" onClick={() => searchService("events", key)}
                        data-tip="Cliquer moi pour voir les prestations de cette évenement">Les prestations
                    </button>
                </div>
            </div>
        );
    };

    const generatorThematicCard = (title, key, image, desc, position_name) => {
        return (
            <div className={lightModeOn ? (position_name + " theme-light") : (position_name + " theme-dark")} style={{ margin: "20px" }}>
                <div className="card-image">
                    <img alt={title} src={image} />
                </div>
                <div className="card-text text-center m-2">
                    <h4 className="text-red">{title}</h4>
                    <small className={lightModeOn ? "text-black" : "text-white"}>{desc}</small>
                    <button className="btn btn-outline-info mt-1" onClick={() => { setThematics(key); setShow(true); }}
                        data-tip="Cliquer moi pour voir les prestations de cette univer">Les prestations
                    </button>
                </div>
            </div>
        )
    };

    return (
        <div className="p-b-100">
            <ReactTooltip />
            <Modal open={show} disableScrollLock={true}>
                <div className="form-material"
                    style={{ border: "2px solid red", borderRadius: "5px", marginTop: "150px", marginLeft: '450px', width: '400px' }}>
                    <button className="ModalClose" onClick={(e) => setShow(false)} style={{ margin: "2px" }}>
                        <i className="icon-close s-24" style={{ color: "orange" }} />
                    </button>
                    <div className="col text-center">
                        <div className="body">
                            <h3 className="text-light pt-5 mb-3">Vous le voulez pour quelle genre d'evenements ?</h3>
                            {/* <Select options={listOfEvents} placeholder="Choisir l'évenements"
                                onChange={obj => {
                                    onChangeListWithValueLabel(setEvents, obj, dispatch, changeEventsToSearch)
                                }} /> */}

                            <ThemeProvider theme={defaultMaterialTheme}  >
                                <FormControl style={{margin:'10px'}}>
                                    <InputLabel id="demo-dialog-select-label" >Choisir l'évenements</InputLabel>
                                    <NativeSelect
                                        value={listOfEvents.value}
                                        placeholder="Choisir un pays"
                                        onChange={obj => {
                                            onChangeListWithValueLabel(setEvents, obj, dispatch, changeEventsToSearch)
                                        }}
                                        // className={classes.select}
                                        // classes={{ icon: classes.icon }}
                                        inputProps={{
                                            name: 'events',
                                            id: 'age-native-helper',
                                        }}

                                    >
                                        <option value="" />
                                        {
                                            listOfEvents.map((data) => ([
                                                <option key={data.value} value={data.value}
                                                    style={{ color: 'black' }}>{data.label}</option>
                                            ]))
                                        }

                                    </NativeSelect>
                                </FormControl>
                            </ThemeProvider>
                            <button className="btn btn-outline-success btn-sm pl-5 pr-5 mt-4" style={{ marginBottom: '5px' }}
                                onClick={() => {
                                    if (events) {
                                        setShow(false);
                                        searchService("thematics", thematics).then(r => null);
                                    } else toast.error("Veuillez selectionner l'evenement")
                                }}>Envoyer
                            </button>
                        </div>
                    </div>
                </div>
            </Modal>
            {/* Type of Events */}
            <div className="pt-5">
                <KantoTabs
                    headerColor={lightModeOn ? 'white' : 'black'}
                    tabs={[
                        {
                            tabName: (
                                < div >
                                    <h1 className="mb-2 text-primary">Nos Evenements</h1>
                                    <p className={lightModeOn ? "text-black" : "text-white"}>Voici tout les differentes enevements dans KantoBiz</p>
                                </div>
                            ),


                            tabContent: (
                                <div className="card-container">
                                    {generatorEventCard("card-left", "Mariage", "Mariage", "Un show pour vous rien que pour vous", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRvmV7Vhz-LjwgtoZugC3GSKvTYvRr3EFB2I-QAL9pGeWAygh4m&usqp=CAU")}
                                    {generatorEventCard("card-top", "Fête traditionnelle", "Fête traditionnelle", "Un évènement particulier, des artistes particuliers", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQMbR1baf8-G6c6LeMp2xFDdBX3M4nnQ29uwkZsmqfKS9_kofmg&usqp=CAU")}
                                    {generatorEventCard("card-right", "Anniversaire", "Anniversaire", "Allumez le feu lors de votre anniversaire", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRVAaYVSLUZ4MUhuVwRuM_Cs80l3pFHs6gwcU0OiaPTvvm0pgRw&usqp=CAU")}
                                    {generatorEventCard("card-right", "Show-case", "Show-case", "Pour une animation réussie", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTirXD8lxMq49ZL5Qd4yRFtjUn2iu5A7ZGcVtYn7PArYy_Gl_4y&usqp=CAU")}
                                    {generatorEventCard("card-right", "Festival et défilé", "Festival & défilé", "L'expérience musicale qui vous transcende", "data:image/jpeg;base64,")}
                                    {generatorEventCard("card-bottom", "Événement sportif", "Événement sportif", "Sport & Musique comme Roméo & Juliette", "data:image/jpeg;base64,")}
                                    {generatorEventCard("card-left", "Montage vidéo", "Montage vidéo", "Pour un service personnalisé en montage vidéo", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcS1eap9n7plK_DG5_wnuXFJZ3hLgI3uPZFhc2wUcCstz-TEv5MQ&usqp=CAU")}
                                    {generatorEventCard("card-left", "Évènement d’entreprise", "Évènement d’entreprise", "Animer un salon, un congrès, une exposition, un gala, un évènement de lancement, une réception, un team building, etc...", "data:image/jpeg;base64,")}
                                    {generatorEventCard("card-left", "Évènement associative", "Évènement associative", "Pour un évènement associatif réussi", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcS7oHy5DEQ3Q7pA88TLwwMayz2cq1DmzTFGnlm8iTYyy3l2XPDp&usqp=CAU")}
                                    {generatorEventCard("card-right", "Création d’instrumentale", "Création d’instrumentale", "Des beatmakers à votre disposition pour créer des instrus personnalisés ", "data:image/jpeg;base64,")}
                                    {/*{generatorEventCard("card-left", "Autres évènements", "Voir d'autres évènements ", "https://images.pexels.com/photos/997725/pexels-photo-997725.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260")}*/}

                                </div>
                            )
                        }, {
                            tabName: (
                                <div>
                                    <h1 className="mb-2 text-primary">Nos Thematiques/Univers</h1>
                                    <p className={lightModeOn ? "text-black" : "text-white"} >Voici tout les differentes univers dans KantoBiz</p>
                                </div>
                            ),
                            tabContent: (
                                <div className="card-container">
                                    {generatorThematicCard("Cirque/Arts de la rue", "street_artists", "data:image/jpeg;base64,", "acrobate, clown, cracheur de feu, dompteur Equilibriste, jongleur ...", "card-left")}
                                    {generatorThematicCard("Comédiens", "comedian", "data:image/jpeg;base64,", "Burlesque, Comédie, Conteur, Humoriste, expérimental ...", "card-left")}
                                    {generatorThematicCard("DJ", "dj", "data:image/jpeg;base64,", "Animateur, Mix, Live set, DJ Set", "card-bottom")}
                                    {generatorThematicCard("Danseurs", "dancers", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQPsxTpKZeQx1Gonb6myQdrkPwV_atOdYfzcrFYRefhHxuERs-I&usqp=CAU", "Tango, kilalaky, batrelaky, Ndombolo, Kizomba ...", "card-right")}
                                    {generatorThematicCard("Magiciens", "magician", "data:image/jpeg;base64,", "Close-ups, Mentalistes, Prestidigitateurs ...", "card-right")}
                                    {generatorThematicCard("Chanteur/Musicien", "artist_musician", "https://images.pexels.com/photos/668295/pexels-photo-668295.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260", "Acapella, Afrobeat, Batrelaky, Reggae-muffin, Reggaeton ...", "card-right")}
                                    {generatorThematicCard("Beatmaking", "beatmaker", "data:image/jpeg;base64,", "Jazz, Pop, Rnb, Rap, Coupé-Décalé ...", "card-right")}
                                    {generatorThematicCard("Spécialiste de l’audiovisuel", "audiovisual_specialist", "data:image/jpeg;base64,", "Monteur vidéoclip, Cameraman, Photographes, Réalisateur clip vidéo ...", "card-right")}
                                    {/*{generatorThematicCard("Spectacles enfants", "https://zupimages.net/up/19/18/3ltf.png", "Clown")}*/}
                                </div>
                            )
                        }
                    ]
                    }

                />


            </div>
            {/* End type of Events */}
            {/* All thematics */}
            {/* <div className="thematics pt-5">
                <Tabs


                />

            </div> */}
            {/* {/* End thematics */}
        </div>
    )
};
